var __index = {"config":{"lang":["en"],"separator":"[\\s\\-]+","pipeline":["stopWordFilter"]},"docs":[{"location":"index.html","title":"Home","text":""},{"location":"index.html#welcome-to-the-documentation-for-aaron-collins-github-projects","title":"Welcome To The Documentation For Aaron Collins' Github Projects","text":"<p>This microsite serves as a documentation hub for my projects. It was built using mkdocs and the material theme. The microsite is hosted via Github Pages.</p> <p>Feel free to explore this site and learn more about my projects. If you have any questions, feel free to contact me at aaron777collins@gmail.com. You can also learn more about me on my main site. Don't forget to check out the repository for this site. Thanks for visiting!</p> <p>Note: Many projects haven't been documented here yet. Please visit my Github to see the rest of my projects.</p>"},{"location":"index.html#featured-projects","title":"Featured Projects","text":""},{"location":"index.html#connecteddrivingpipelinev4","title":"ConnectedDrivingPipelineV4","text":"<p>This pipeline is part of my Connected Driving Pipelines and is the most recent version. It has new features such as automatic caching, dependency injection, and context/path providers. Check out the repository and the documentation for more information.</p>"},{"location":"index.html#links","title":"Links","text":"<ul> <li>Main Site - Personal Portfolio.</li> <li>Github Repos (including those that haven't been added here yet)</li> <li>Github Projects Documentation Repo</li> <li>mkdocs</li> <li>material theme</li> <li>Github Pages</li> </ul>"},{"location":"ConnectedDrivingPipelines.html","title":"Connected Driving Pipelines","text":""},{"location":"ConnectedDrivingPipelines.html#introduction","title":"Introduction","text":"<p>I created a few different connected driving pipelines. Each pipeline has improvements on the previous pipeline. Here are the current pipelines, ordered from latest to oldest:</p>"},{"location":"ConnectedDrivingPipelines.html#connecteddrivingpipelinev4-4th-pipeline","title":"ConnectedDrivingPipelineV4 (4th Pipeline)","text":"<p>This is the latest connected driving pipeline. It has new features such as automatic caching, dependency injection, and context/path providers.</p>"},{"location":"ConnectedDrivingPipelines.html#summary","title":"Summary","text":"<p>This pipeline was created to end the continuous cycle of making maching learning (ML) pipelines for connected driving.</p> <p>The pipeline was created for connected driving research. The goal is to create a better, more realistic dataset for training malicious bsm detection systems in the connected driving space. The current datasets, such as Veremi and Veremi Extension are too easy to train detection models for and don't model the world realistically.</p> <p>We took the Wyoming CV Pilot Basic Safety Message One Day Sample dataset from OpenDataNetwork as our original, real data.</p> <p>This pipeline creates malicious datasets based on customizable attacks and then tests them using machine learning models such as Random Forest, Decision Tree and K-Nearest-Neighbours.</p> <p>You can visit the documentation at www.aaroncollins.info/ConnectedDrivingPipelineV4/ and the repository at github.com/aaron777collins/ConnectedDrivingPipelineV4.</p>"},{"location":"ConnectedDrivingPipelines.html#connecteddrivingresearch-3rd-pipeline","title":"Connecteddrivingresearch (3rd Pipeline)","text":""},{"location":"ConnectedDrivingPipelines.html#summary_1","title":"Summary","text":"<p>This pipeline was created to start generating BSMs rather than relying on the VEREMI dataset. It was messy and not very well documented. The 4th version was created to fix these issues.</p> <p>This pipeline used real data from the Wyoming CV Pilot Basic Safety Message One Day Sample dataset from OpenDataNetwork as our original, real data. We added malicious data to some of the BSMs and then trained machine learning models to detect the malicious BSMs.</p> <p>You can see the repository at github.com/aaron777collins/connecteddrivingresearch.</p>"},{"location":"ConnectedDrivingPipelines.html#connecteddrivingmachinelearningpipeline-2nd-pipeline","title":"ConnectedDrivingMachineLearningPipeline (2nd Pipeline)","text":""},{"location":"ConnectedDrivingPipelines.html#summary_2","title":"Summary","text":"<p>This pipeline used the Veremi dataset to train machine learning models to detect malicious data within BSMs. It was a good start, but the dataset was too easy to train models for. Thus, the 3rd pipeline was created to generate more realistic data.</p> <p>You can see the repository at github.com/aaron777collins/ConnectedDrivingMachineLearningPipeline.</p>"},{"location":"ConnectedDrivingPipelines.html#httpsgithubcomaaron777collinsconnecteddrivingdatagenerator-1st-pipeline","title":"https://github.com/aaron777collins/ConnectedDrivingDataGenerator (1st Pipeline)","text":""},{"location":"ConnectedDrivingPipelines.html#summary_3","title":"Summary","text":"<p>This pipeline was actually built off of VEINS to simulate cars talking to eachother in a virtual environment. Most of the code was taken from the VEINS tutorial and modified to fit our needs. This pipeline was abandoned because of the difficulty setting it up and making changes to fix our needs. The high learning curve was not worth it when we could just use the Veremi dataset. No machine learning was done in this pipeline.</p> <p>You can see the repository at github.com/aaron777collins/ConnectedDrivingDataGenerator.</p>"},{"location":"ConnectedDrivingPipelines.html#links","title":"Links","text":"<ul> <li>ConnectedDrivingPipelineV4 Docs</li> <li>ConnectedDrivingPipelineV4 Github Repo</li> <li>connecteddrivingresearch Github Repo</li> <li>ConnectedDrivingMachineLearningPipeline Github Repo</li> <li>ConnectedDrivingDataGenerator Github Repo</li> <li>VEINS</li> <li>Veremi</li> <li>Veremi Extension</li> <li>Wyoming CV Pilot Basic Safety Message One Day Sample</li> <li>Random Forest Classifier</li> <li>Decision Tree Classifier</li> <li>K-Nearest-Neighbours Classifier</li> </ul>"},{"location":"PersonalPortfolio.html","title":"Personal Portfolio - aaron777collins.github.io","text":""},{"location":"PersonalPortfolio.html#summary","title":"Summary","text":"<p>This site acts as a personal portfolio for me. It's built using Typescript, React and Material UI. It's hosted on Github Pages and is available at www.aaroncollins.info.</p> <p>You can also visit the repository at https://github.com/aaron777collins/aaron777collins.github.io</p>"},{"location":"PersonalPortfolio.html#links","title":"Links","text":"<ul> <li>Personal Portfolio</li> <li>Repository</li> </ul>"},{"location":"VimConfig.html","title":"My Vim Configuration - Vim-Config","text":""},{"location":"VimConfig.html#summary","title":"Summary","text":"<p>This repository contains my vim configuration files. It's a work in progress because I'm still learning how to use vim. I'm using Vim-Plug and Vundle.</p> <p>You can view the repository at github.com/aaron777collins/vim-config</p>"},{"location":"VimConfig.html#links","title":"Links","text":"<ul> <li>Repository</li> <li>Vim-Plug</li> <li>Vundle</li> </ul>"},{"location":"python3-image.vim.html","title":"A Vim Module For Image Viewing - python3-image.vim","text":""},{"location":"python3-image.vim.html#summary","title":"Summary","text":"<p>This is a vim plugin that allows you to view images in vim. It's a fork of image.vim which I updated to python3. I also added higher quality ASCII art rendering.</p> <p>You can view the repository at github.com/aaron777collins/python3-image.vim</p>"},{"location":"python3-image.vim.html#links","title":"Links","text":"<ul> <li>Repository</li> <li>image.vim</li> </ul>"}]}